INSERT INTO `pages` (`id`, `content`) VALUES
('aboutus', '&lt;p style=&quot;text-align: center; &quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;bblabla-min.jpg&quot; style=&quot;font-size: 0.875rem; width: 50%;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 0.875rem;&quot;&gt;Siapakah Kami ?&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Kami adalah sekelompok supplier susu di kota bandung . Segala yang kami lakukan di PianetaMilk bertujuan untuk membuat semua anggota keluarga menikmati kemurnian susu perah yang berada di kota bandung. Dengan Menggunakan metode Refill. Dikemas dalam kemasan botol kaca dan diantar oleh kurir resmi dari PianetaMilk dengan tujuan yang baik . Inilah &quot; PianetaMilk Company &quot;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;');
INSERT INTO `pages` (`id`, `content`) VALUES
('business', '&lt;p&gt;burung&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;rul.jpg&quot; style=&quot;width: 388px;&quot;&gt;&lt;br&gt;&lt;/p&gt;'),
('commitment', '<p style=\"text-align: left;\"><b>KOMITMEN KAMI :</b></p><ul><li style=\"text-align: left;\">Menjaga profesionalisme</li><li style=\"text-align: left;\">Memberi pelayanan yang terbaik untuk pelanggan</li><li style=\"text-align: left;\">Mendistribusikan susu tepat waktu</li><li style=\"text-align: left;\">Menjaga kepercayaan pelanggan</li></ul>'),
('contactus', '&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 0.875rem;&quot;&gt;&lt;b&gt;ANDA MENGALAMI KESUSAHAN ? SILAHKAN HUBUNGI KAMI DI AKUN SOSIAL MEDIA KAMI&lt;/b&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 0.875rem;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 0.875rem;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 0.875rem;&quot;&gt;TERIMAKASIH&lt;/span&gt;&lt;/div&gt;&lt;br&gt;&lt;br&gt;&lt;center&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/div&gt;\r\n&lt;div class=&quot;mapouter&quot;&gt;&lt;div class=&quot;gmap_canvas&quot; style=&quot;text-align: center; &quot;&gt;&lt;iframe width=&quot;600&quot; height=&quot;400&quot; frameborder=&quot;0&quot; scrolling=&quot;no&quot; marginheight=&quot;0&quot; marginwidth=&quot;0&quot; src=&quot;https://maps.google.com/maps?width=600&amp;amp;height=400&amp;amp;hl=en&amp;amp;q=jl mars selatan 2 no 10&amp;amp;t=&amp;amp;z=14&amp;amp;ie=UTF8&amp;amp;iwloc=B&amp;amp;output=embed&quot;&gt;&lt;/iframe&gt;&lt;a href=&quot;https://piratebayproxy.net/&quot; style=&quot;font-family: sans-serif; font-size: 0.875rem; font-weight: 400;&quot;&gt;proxy&lt;/a&gt;&lt;/div&gt;&lt;style&gt;.mapouter{position:relative;text-align:right;width:600px;height:400px;}.gmap_canvas {overflow:hidden;background:none!important;width:600px;height:400px;}&lt;/style&gt;&lt;/div&gt;&lt;/center&gt;');
INSERT INTO `pages` (`id`, `content`) VALUES
('cows', '&lt;p style=&quot;text-align: center; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;&lt;img src=&quot;data:image/png;base64,&quot; data-filename=&quot;Screenshot_2.png&quot; style=&quot;width: 50%;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;Susu yang bermutu tinggi hanya dapat dihasilkan dari sapi yang sehat. Untuk menjamin susu berkualitas terbaik, kami mendatangkan sapi jenis Holstein dan Jersey dengan kualitas unggul dari Australia. Setiap sapi mendapat perawatan kesehatan dan nutrisi yang istimewa dari tim dokter hewan dan ahli gizi untuk memastikan mereka dipelihara sesuai dengan standar peternakan internasional.&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;Sapi-sapi selalu dimanjakan dengan pakan sehat terdiri jagung dengan kualitas terbaik, biji-bijian, Dan jenis rumput lokal khusus yang memiliki kandungan protein dan serat yang tinggi. Pakan bergizi ini membuat sapi ternutrisi dengan baik dan selalu sehat untuk terus memproduksi susu segar lezat yang merupakan ciri khas Susu PianetaMilk. Selain pengaturan nutrisi, sapi kami juga memiliki &lsquo;kasur&rsquo; pasir lembut yang secara teratur dibersihkan dan ditambah setiap hari, dan tidak ketinggalan pula perawatan kuku dua kali setahun&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;Sapi kami juga berolahraga dengan teratur &ndash; mereka berjalan kaki setiap hari dari kandang tempat mereka tinggal ke lokasi pemerahan tiga kali sehari sehingga mereka selalu sehat dan bahagia!&lt;/p&gt;');
INSERT INTO `pages` (`id`, `content`) VALUES
('history', '&lt;p style=&quot;text-align: center; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;pexels-benjamin-lehman-1436130-min-min.jpg&quot; style=&quot;width: 50%;&quot;&gt;&lt;span style=&quot;font-size: 0.875rem;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 0.875rem;&quot;&gt;Awal tahun 1990-an adalah periode di mana Asia Tenggara, termasuk Indonesia, mengalami pertumbuhan ekonomi yang pesat. Di masa itu banyak produk impor memenuhi kebutuhan pasar untuk susu segar. Tidak tadanya peternakan sapi perah komersial berskala besar di Indonesia, dan di sisi lain ketersediaan tenaga kerja dan sumber daya alam yang melimpah, memberikan peluang untuk berdirinya perusahaan susu yang mampu memasok pasar domestik Indonesia dan juga kawasan Asia Tenggara.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;Pada tanggal 20 Agustus 2020 PianetaMilk didirikan . pianetamilk segera memulai bisnis peternakan sapi perah di kabupaten Lembang, Bandung ,JawaBarat .dan membangun fasilitas pengolahan susu &lt;span style=&quot;font-size: 0.875rem;&quot;&gt;yang beroperasi sejak bulan November 2020. Hingga hari ini, produk susu pasteurisasi yang diproduksi oleh Peternakan PianetaMilk adalah produk dengan kualitas tinggi.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;&quot;&gt;Peternakan sapi perah PianetaMilk di Bandung saat ini memiliki lebih dari 53 ekor sapi Holstein yang memproduksi lebih dari  6000 liter susu segar setiap tahunnya. Memberikan kebutuhan bagi penduduk tepatnya yang berada di kota bandung .&lt;/p&gt;');
INSERT INTO `pages` (`id`, `content`) VALUES
('ourfarm', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;\">Peternakan PianetaMilk yang pertama berlokasi pada ketinggian 1.523 meter di dataran tinggi Kota Bandung, tepatnya di Kabupaten Lembang . Di tempat ini, 53 ekor sapi Holstein memiliki peran penting bagi pembuatan produk-produk dairy PianetaMilk di dalam fasilitas yang terintegrasi sepenuhnya. Udara yang sejuk sepanjang tahun dan perlakuan yang beretika oleh para spesialis hewan membuat mereka selalu sehat dan merasa nyaman. Saat sapi sudah diperah maka langsung diproduksi dan dikemas didalam rumah produksi disebelah peternakan PianetaMilk .</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;\"><span style=\"font-size: 0.875rem;\">Untuk Dapat selalu menghadirkan Susu PianetaMilk bagi anda, Kami telah membuka rumah produksi kedua di daerah Margahayu Raya tepatnya di daerah Jl Mars Selatan . Sapi di perah saat Pagi dan saat Sore . sapi yang sudah diperah langsung diantarkan kerumah produksi untuk dikemas.</span></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;\">Peternakan ini Standar Nasional Indonesia , dengan fasilitas yang sedikit modern dan dioperasikan secara manual untuk memproduksi susu berkualitas yang memuhi standar nasional. Susu PianetaMilk tidak hanya lezat, tetapi juga bersih, higienis dan juga memiliki kandungan bakteri yang rendah!</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;\">Dengan lokasi yang strategis, peternakan sapi perah kami juga membantu perkebunan milik penduduk di sekitarnya. Air yang memiliki kandungan pupuk alami dialirkan melalui saluran khusus dari peternakan ke perkebunan penduduk yang berada di lokasi sekitar. Tanaman yang dihasilkan kemudian dijual kembali oleh para petani kepada kami dan digunakan sebagai pakan para sapi, dengan demikian kami selalu dapat menjaga kelezatan Susu PianetaMilk yang istimewa!</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;\"><br></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: Lato, sans-serif;\">SAYANGI ANGGOTA KELUARGA ANDA DENGAN MENGKONSUMSI SUSU PIANETAMILK&nbsp;</p>'),
('philosophy', '<div><font color=\"#202124\" face=\"arial, sans-serif\"><span style=\"font-size: 16px;\"><b>FILOSOFI KAMI :</b></span></font></div><div><font color=\"#202124\" face=\"arial, sans-serif\"><span style=\"font-size: 16px;\"><br></span></font></div><ol><li><span style=\"color: rgb(32, 33, 36); font-family: arial, sans-serif; font-size: 16px;\">Bisnis kami tidak berfokus pada mencari keuntungan semata, namun kami berfokus pada memberikan nilai serta memberikan pelayanan yang lebih kepada orang lain.</span></li><li><font color=\"#202124\" face=\"arial, sans-serif\"><span style=\"font-size: 16px;\">Bisnis kami hanya ingin menyajikan susu yang berkualitas untuk anda minum bersama anggota keluarga agar anggota keluarga anda tetap sehat .</span></font></li></ol>');
